  console.log(productData);

  useEffect(() => {
    ProductService.getById(prams)
      .then((data) => {
        setProductData(data.data);
      })
      .catch((e) => {
        console.log(e);
      });
  }, []);
  return <div>productSelf-component</div>;
};

export default ProductSelf;
